            "term_and_condition": "<p>Mohon dibaca dulu catatan berikut ini :)</p>\n\n<p>Bagi yang mengorder tanpa mencantumkan keterangan warna atau varian (apabila ada), maka barang akan kami kirim secara random ya.</p>\n\n<p>INFO PENGIRIMAN BARANG</p>\n\n<p>Berikut ini adalah info pengiriman barang Electro Claus :</p>\n\n<ul>\n<li><p>Setiap pesanan yang TERVALIDASI sebelum jam 4.00 akan di kirim HARI ITU JUGA (kecuali hari minggu dan hari libur / Mengikuti jadwal buka EXPEDISI di tempat kami</p></li>\n<li><p>Setiap pesanan yang tervalidasi di atas itu akan di kirim KEESOKAN harinya.</p></li>\n<li><p>RESI akan diinput otomatis oleh bagian ekspedisi. Mohon ditunggu perubahan status/update-nya malam hari atau maksimal sampai pagi.</p></li>\n<li><p>Berapa lama sampai ke tempat costumer dan terkendalanya dalam pengiriman bukan tanggung jawab kami, tanggung jawab ada pada expedisi. Kami hanya memastikan barang dikirim ke expedisi, expedisi yang selanjutnya akan membantu mengirimkan barang ke tempat costumer. Tapi kami akan bantu sepenuhnya untuk menghubungi costumer service dari expedisi yang bersangkutan dan membantu follow-up setiap product yang terkendala secara tidak normal dalam pengiriman.</p></li>\n<li><p>Kami merekomendasikan untuk menyertakan asuransi di setiap pengiriman barang</p></li>\n</ul>\n\n\n<p>Pengiriman BY GO-SEND :</p>\n\n<ul>\n<li><p>Perlu di ketahui pengiriman by Go-Send yang melakukan order bukan penjual, melainkan Market Place tersebut, jadi harus mengikuti aturan dari Market Place Tersebut.</p></li>\n<li><p>Setiap orderan Go-Send MAKSIMAL pukul 16.00 (aturan dari ), oleh karna itu setiap orderan Go-Send yang tervalidasi sebelum jam 15.00 akan kami kirim hari itu juga, validasi pukul 15.00 - 16.00 akan kami USAHAKAN agar terkirim hari itu juga.</p></li>\n<li><p>Validasi Go-Send di atas jam 16.00 akan di kirim esok hari.</p></li>\n<li><p>Khusus orderan Go-Send URGENT hari minggu, mohon di infokan terlebih dahulu agar kami bisa membantu mengirimkan barang di hari Minggu.</p></li>\n<li><p>Tidak ada jaminan Go-Send yang tervalidasi sebelum jam 15.00 pasti terkirim hari itu juga, kami penjual hanya melakukan PROSES PICKUP untuk memanggil Go-Send, dalam sistim Go-Send mungkin terkendala gagal menemukan Driver, sehingga orderan tidak dapat terkirim.</p></li>\n</ul>\n\n\n<p>PROSEDUR PENGEMBALIAN BARANG:</p>\n\n<ol>\n<li><p>Kami mengutamakan dan sangat menghargai komunikasi terlebih dahulu untuk setiap kendala dan masalah produk yang terkirim, oleh karena itu untuk setiap claim wajib di infokan terlebih dahulu secara personal (bukan diskusi / ulasan).</p></li>\n<li><p>Pembeli wajib memberikan rating positif dan feedback positif untuk setiap claim warranty yang kami bantu ke supplier agar komunikasi tercipta dengan baik.</p></li>\n<li><p>Kami bertanggung jawab sesuai dengan warranty yang tertulis dan diberikan di lapak untuk setiap produk yang kami jual.</p></li>\n<li><p>Kami masih menerima pengembalian barang jika customer mengembalikan barang ke kami SAAT jangka waktu garansi masih ada</p></li>\n<li><p>Apabila ingin meng-claim barang, cukup infokan nomor invoice &amp; Nama account pembeli dari MARKET PLACE (tidak usah melampirkan invoice) karna invoice sudah tercatat secara sistim dan kami bisa melacak setiap pembelian product yang ada.</p></li>\n<li><p>Barang wajib masih dalam kondisi lengkap (terutama stiker warranty masih tersegel), karna kami hanya membantu claim ke supplier yang menyuplai barang tersebut. (kecuali untuk produk-produk tertentu dengan packing solid)</p></li>\n<li><p>Wajib menginfokan dan menceritakan secara rinci kendala dan permasalahan produk tersebut, agar memudahkan dan mempercepat proses claim barang tersebut.</p></li>\n<li><p>Ongkos kirim pulang dan pergi di tanggung oleh pembeli sepenuhnya (mohon sertakan ongkos kirim pengembalian saat barang claim dikirim ke kami)</p></li>\n<li><p>Warranty dapat VOID (tidak di terima) jika oleh supplier terbukti bahwa kerusakan yang terjadi di sebabkan karna human error (kabel terkelupas, jatuh, pecah, terkena air dsbnya). Supplier yang mementukan, kami akan membantu maksimal dalam proses claim product tersebut.</p></li>\n</ol>\n\n\n<p>PENGISIAN BATERAI EARPHONE</p>\n\n<p>Untuk perangkat earphone yang memerlukan pengisian baterai, mohon untuk tidak melakukan overcharge dan jangan ditinggal semalaman karena akan berpotensi merusak baterai.</p>\n\n<p>Masa pengecasan setiap earphone berbeda-beda, tergantung kapasitas baterai dari earphone tersebut. Mohon untuk melihat di user manual untuk waktu pengecasan, atau kenali perangkat earphone Anda saat pertama kali pengecasan (normalnya 2-4 jam).</p>\n\n<p>Untuk produk earphone yang rusak karena human error (jatuh, kena air, kabel ketarik, overcharge, dsb), maka produk tersebut akan ditolak untuk pereturan meskipun masa garansi masih berlaku.</p>\n\n<p>Terima Kasih</p>\n\n<p>Electro Claus :)</p>\n",
